import React from "react";

const Products = () => {
  return (
    <div className="px-2 lg:px-7 pt-5">
      <h1 className="text-[#d0d2d6] font-semibold text-lg">Category</h1>
      <div className="w-full p-4 bg-[#6a5fdf] rounded-md "></div>
    </div>
  );
};

export default Products;
